Wanneer de recht naar het doel werkende FBI-agent Roy Clayton de leiding neemt in een onderzoek naar internationale 
samenzweringen, lijken alle sporen naar de voormalige U.S. Special Operations-officier Samir Horn te leiden. Het 'inter-agency 
task force' kijkt in deze zaak uit naar een ontmoeting met Carter, een veteraan van de CIA die blijkbaar zijn eigen agenda heeft 
en naar Max Archer, een bevriende FBI-agent. De 'task force' linkt Horn met een gevangenisontsnapping in Jemen, een bomaanslag in 
Nice en een overval in Londen. Geobsedeerd door het vinden van de waarheid, zoekt Clayton Horn over de hele wereld en dit terwijl 
de illustere en onvatbare ex-CIAer zich dieper en dieper ingraaft in een wereld van schaduwen en intriges.
